import numpy as np

AGTC = np.array([["A", "G", "T", "C"], ["T", "C", "A", "G"]])

def Reverse (Pattern):
    cPattern = []
    for i in range(len(Pattern)):
        for j in range(4):
            if Pattern[i] == AGTC[0, j]:
                cPattern.append(AGTC[1, j])
    cPattern.reverse()
    return cPattern

print("".join(Reverse("")))